import React from "react";

const VideoItems = ({ video }) => {
  // video above is a destrucutured prop
  return (
    <div className="item">
      <img className="" src={video.snippet.thumbnails.medium.url} />
      {video.snippet.title}
    </div>
  );
};

export default VideoItems;
